@extends('base')

@section('nav')
    <ul>
        <li id="b1">О нас</li>
        <li id="b2">Направления</li>
        <li id="b3">Контакты</li>
    </ul>  
@endsection

@section('nav-mobile')
    <ul>
            <li id="mb1">О нас</li>
            <li id="mb2">Направления</li>
            <li id="mb3">Контакты</li>
    </ul>
@endsection

@section('main_content')
    

    
    <!-- slider -->

    <div class="section-outor slider-bg">
        
        <div class="section-inner">

            <!-- оболочка слайдера  -->
        
            <div id="head1" class="slider">
                <!-- Slider main container -->
                <div class="swiper swiper1">
                    <!-- Additional required wrapper -->
                    <div class="swiper-wrapper">
                        <!-- Slides -->
                        @if(count($slides)>=1)
                        @foreach($slides as $slide)
                        <div class="swiper-slide">
                            <div class="carousel-item">
                                <div class="carousel-item__image">
                                    <img src="storage/slider_image/{{$slide->slide_image}}" alt="Image">
                                </div>
                                <div class="carousel-item__content">
                                    <div class="item-content__title">
                                        {{$slide->slide_title}}
                                    </div>
                                    <div class="item-content__subtitle">
                                        {{$slide->slide_body}}
                                    </div>
                                </div>
                            </div>
                        </div>
                        @endforeach
                        @else
                        <div class="swiper-slide">
                            <div class="carousel-item">
                                <div class="carousel-item__image">
                                    <img src="image/no-image.jpg" alt="Изображение">
                                </div>
                                <div class="carousel-item__content">
                                    <div class="item-content__title">
                                        Заголовок
                                    </div>
                                    <div class="item-content__subtitle">
                                        Описание
                                    </div>
                                </div>
                            </div>
                        </div>
                        @endif
                    </div>

                    <div class="swiper-control-btn">
                        <div class="btn-prev"></div>
                        <div class="btn-next"></div>
                    </div>

                </div>
            </div>
        </div>
    </div>

    <!-- numbers -->

    <div id="el1" class="section-outor numbers-bg">
        <div class="section-inner">
            <div class="numbers">
                <div class="numbers-item">
                    <div class="numbers-item__title">23</div>
                    <div class="number-line"></div>
                    <div class="numders-item__subtitle">региона</div>
                </div>
                <div class="numbers-item">
                    <div class="numbers-item__title">9</div>
                    <div class="number-line"></div>
                    <div class="numders-item__subtitle">компаний</div>
                </div>
                <div class="numbers-item">
                    <div class="numbers-item__title">20</div>
                    <div class="number-line"></div>
                    <div class="numders-item__subtitle">лет работы</div>
                </div>
                <div class="numbers-item--8">
                    <div class="numbers-item__title">8</div>
                    <div class="number-line"></div>
                    <div class="numders-item__subtitle">собственных <br> патентов </div>
                </div>
            </div>
        </div>
    </div>

